import React, { Component } from 'react';
import vegetableData from '../data/vegetableData.json';
import { searchVegetable, filterHandler, addToCartHandler, removeFromCartHandler } from '../helperFunction/stateChangeFunctions';
import {FILTER_TYPES, CART_STATUS} from '../data/constData';
import Navbar from './components/billingPage/organisms/header/Navbar';
// import BillingMain from './billingPage/templates/BillingMain';
// import ServiceTemplate from './billingPage/templates/ServiceTemplate';
// import Foot from './billingPage/UI/organisms/footer/Foot';

class BillingPage extends Component {
    constructor(props) {
        super(props)
        this.state = {
            vegetableData: vegetableData,
            cartStatus: CART_STATUS
        }
        this.searchVegetable = searchVegetable.bind(this);
    }

    render() {
        return (
            <>
                <Navbar searchVegetable={this.searchVegetable} cartStatus={this.state.cartStatus} />
                {/* <BillingMain />
                <ServiceTemplate />
                <Foot /> */}
            </>
        )
    }
}

export default BillingPage
